INSERT INTO `products` (`product_id`, `category_id`, `product`, `brief`, `description`, `price`, `quantity`, `status`, `image`, `date_added`) VALUES
	(1, 3, 'Fortnite - Merry Minty Pickaxe Skin Epic Games', 'Cheap 65 inch touch screen computer all in one pc touch computer for meeting room', 'The holiday season is approaching fast and that means the Fortnite Christmas event is just around the corner. \r\nMake sure you are ready for it!\r\n\r\nA Fortnite seasonal cosmetic called the Merry Mint Pickaxe has players frantically searching for what it is and how to get it.\r\nGet the pickaxe on GAMIVO and amaze your friends and enemies!\r\n\r\nThe Pickaxe, also known as a harvesting tool, is a tool that players can use to mine and break materials in the world of Fortnite.\r\nView Angle: 178(H)/178(V)\r\nKeybord: Touch computer\r\nWarranty: 3 Years', 30.00, 20, 'Available', '1576451657280', '2019-12-11 17:20:00'),
	(2, 3, 'FIFA 20 Origin CD Key', '', 'FIFA 20 Pre-Order best price\r\nThe sequel to the critically acclaimed sports game FIFA 19 is coming!\r\n\r\nFIFA 20 is the next installment of the popular series of football simulators launched in 1993. Title is improving a formula developed by the previous games in the series, offering fun for both single-player and multiplayer fans. As every year, in the game we will find real players and teams that we can lead to victory in subsequent matches. EA Sports studio is responsible for the production again.\r\n\r\nThe biggest changes that can be found in the latest installment of the series include the VOLTA Football mode. It allows you to play outside of stadiums â€” on pitches located e.g. in underground passages or on the roofs of skyscrapers. In this form of play, the player creates his avatar (male or female) and plays matches 3v3 Rush (without goalkeepers), 4v4, 4v4 Rush (without goalkeepers), 5v5 and Professional Futsal.\r\n\r\nFIFA 20 allows players to play matches, meetings and tournaments with the participation of licensed national teams and club football teams from around the world. Particular emphasis was placed on increasing the realism of fun. Artificial intelligence has been improved â€” especially in the field of defenders and goalkeepers\' behavior. Automatic positioning and selection of players in regular match fragments and switching between players has also been improved.\r\n\r\nFIFA 20 has also undergone many minor changes compared to the previous installment of the series. Most of them are limited to minor modifications to the gameplay mechanics. In the case of technical tricks, the margin of errors that can be made when doing tricks has been widened. Passing has been made more difficult â€” the accuracy of the first ball and volley hits has been reduced. In addition, accuracy has been increased, shots restricted with the outer part of the foot to players with appropriate characteristics, and the goalkeeper\'s movement slowed down when the player is controlling it.\r\n\r\nPre-Order FIFA 20 Origin key and secure the copy for yourself on the release date on 27th of September 2019.\r\n\r\n', 88.00, 12, 'Available', '1576451387578', '2019-12-11 21:33:00'),
	(3, 3, 'Grand Theft Auto V GTA 5', 'new premium latest computer 2.4ghz usb wireless white color computer keyboard and mouse combo', '\r\nGRAND THEFT AUTO V: PREMIUM ONLINE EDITION\r\n\r\nThe Grand Theft Auto V: Premium Online Edition includes the complete Grand Theft Auto V story experience, free access to the ever-evolving Grand Theft Auto Online and all existing gameplay upgrades and content including The Doomsday Heist, Gunrunning, Smugglerâ€™s Run, Bikers and much more. Youâ€™ll also get the Criminal Enterprise Starter Pack, the fastest way to jumpstart your criminal empire in Grand Theft Auto Online.\r\n\r\nFeatures\r\nGRAND THEFT AUTO V\r\n\r\nWhen a young street hustler, a retired bank robber and a terrifying psychopath land themselves in trouble, they must pull off a series of dangerous heists to survive in a city in which they can trust nobody, least of all each other.\r\n\r\nGRAND THEFT AUTO ONLINE\r\n\r\nDiscover an ever-evolving world of choices and ways to play as you climb the criminal ranks of Los Santos and Blaine County in the ultimate shared Online experience.\r\n\r\nTHE CRIMINAL ENTERPRISE STARTER PACK\r\n\r\nThe Criminal Enterprise Starter Pack is the fastest way for new GTA Online players to jumpstart their criminal empires with the most exciting and popular content plus $1,000,000 bonus cash to spend in GTA Online - all content valued at over GTA$10,000,000 if purchased separately.\r\n\r\nLAUNCH YOUR CRIMINAL EMPIRE\r\n\r\nLaunch business ventures from your Maze Bank West Executive Office, research powerful weapons technology from your underground Gunrunning Bunker and use your Counterfeit Cash Factory to start a lucrative counterfeiting operation.\r\n\r\nA FLEET OF POWERFUL VEHICLES\r\n\r\nTear through the streets with a range of 10 high-performance vehicles including a Supercar, Motorcycles, the weaponized Dune FAV, a Helicopter, a Rally Car and more. Youâ€™ll also get properties including a 10 car garage to store your growing fleet.\r\n\r\nWEAPONS, CLOTHING & TATTOOS\r\n\r\nYouâ€™ll also get access to the Compact Grenade Launcher, Marksman Rifle and Compact Rifle along with Stunt Racing Outfits, Biker Tattoos and more.\r\n\r\nAlready played Grand Theft Auto 5? Be sure to Pre-Order Grand Theft Auto 6 here!\r\nworking distance: 8-10m\r\nkeyword: keyboard and mouse combo', 70.50, 7, 'Available', '1576451720734', '2019-12-11 21:38:00'),
	(4, 1, 'Playstation Network Card 50 EUR DE PSN', '4 nic 4 lan port linux slim case micro mini pc windows 10 pro 12v mini computer', 'The PlayStation Store wallet has a limit of $150\r\nDownload the latest games and add-ons: Discover and download tons of great PS4, PS3, and PS Vita games and DLC content to give you more\r\nAccess your favorite movies and TV shows: Rent or purchase the newest and biggest movies and TV shows available, and download or stream them instantly to your favorite PlayStation devices\r\nConnect with millions and start playing: Take your PlayStation games to the next level by downloading the latest multiplayer maps, missions, and characters to play online with friends', 150.00, 5, 'Available', '1576455047977', '2019-12-11 21:39:00'),
	(5, 3, 'Planet Zoo Steam CD Key', '', 'Build a world for wildlife in Planet Zoo. From the developers of Planet Coaster and Zoo Tycoon comes the ultimate zoo sim, featuring authentic living animals who think, feel and explore the world you create around them. Experience a globe-trotting campaign or let your imagination run wild in the freedom of Sandbox mode. Create unique habitats and vast landscapes, make big decisions and meaningful choices, and nurture your animals as you construct and manage the worldâ€™s wildest zoos.', 33.47, 10, 'Available', '1576450385554', '2019-12-15 23:53:00'),
	(6, 3, 'Call of Duty: Modern Warfare Green', '', 'The stakes have never been higher as players take on the role of lethal Tier One operators in a heart-racing saga that will affect the global balance of power. Call of Duty: Modern Warfare engulfs fans in an incredibly raw, gritty, provocative narrative that brings unrivaled intensity and shines a light on the changing nature of modern war.', 75.66, 8, 'Available', '1576450649212', '2019-12-15 23:57:00'),
	(7, 3, 'Halo: The Master Chief Collection EU Steam', 'How to Activate:\r\n\r\nYou will receive a gift link to the external provider\'s website in your web browser.\r\nLogin there using your Steam account.\r\nMake sure to choose the same country as your store country found in Steam account details.\r\nThe automated syst', 'Includes: all four games at Xbox One visual fidelity and 60 fps, including a fully remastered Halo 2: Anniversary. Featuring campaigns and multiplayer maps from Halo: Combat Evolved, Halo 2, Halo 3 and Halo 4, plus access to the live-action digital series Halo: Nightfall.\r\n\r\nHalo 2: Anniversary celebrates the 10 year anniversary of the iconic fan favorite. The campaign features a â€œClassic Modeâ€ to instantly switch between the remastered next-gen graphics and original game, updated sound effects, and completely new cut-scenes created by Blur Studios. Discover new story elements with extended cut scenes, hidden terminal videos, and uncover clues about the story of Halo 5: Guardians. Utilize game-altering Skulls to experience the campaign in a whole new way. For multiplayer you have access to all of the original multiplayer maps from Halo 2 and Halo 2 Vista included, exactly as you remember them. Play on fan favorites including Ivory Tower, Ascension, and Lockout, plus 6 completely re-imagined maps that take full advantage of the capabilities of the Xbox One.*\r\n\r\nIn addition to the 45 campaign missions you get with Halo: The Master Chief Collection, you can play with your friends on over 100 multiplayer maps (including the original Halo: Combat Evolved maps) and all Halo: Spartan Ops missions.* With the Master Menu, play all four games from start to finish, or jump around and play your favorite missions. Use curated playlists to experience both the campaign and multiplayer modes in a whole new way.\r\n\r\nRemaking the Legend - Halo 2: Anniversary is a documentary chronicling 343 Industriesâ€™ journey as they re-imagine Halo 2, one of the most beloved video games of all time, for its ten-year anniversary.\r\n\r\nGet unprecedented access to the development process as 343 and their team of partners from around the world bring Halo 2 to the Xbox One, while maintaining and honoring its fabled past.\r\n\r\nHalo: Nightfall provides insight into the origin and backstory of legendary manhunter Agent Locke (Mike Colter), a pivotal new character in the Halo universe who will play a key role in Halo 5: Guardians.\r\n\r\nDiscover the best Game Key and Steam Gifts offers, compare prices to download and play Halo: The Master Chief Collection EU at the best price. Compare Steam Gift prices from merchants all around the world. Activate CD Key on your Steam client to download the game and play in multiplayer.\r\n\r\nGAMIVO is a platform to find, compare and buy digital game keys. Only verified and trusted merchants can sell digital goods on GAMIVO.\r\n\r\nAdd the Steam Gift to your Steam account, the game you bought will be added to your library. Now you can download Steam PC video games for free at any time you want whenever you install Steam client.\r\n\r\nHow to activate Steam Gift?\r\n\r\nFollow instructions in Activation Details section to activate your new Steam Gift.\r\n\r\nLaunch Steam and log in to your account. Go to Games and then click Activate a Product on Steam. Enter the cd key code you have received. The game cd key has been activated and added to your Steam library. You can play now!', 85.99, 6, 'Available', '1576450830849', '2019-12-15 23:58:00'),
	(8, 3, 'Darksiders: Genesis Steam', '', 'From the dawn of creation, THE COUNCIL has maintained the Balance across existence. Carrying out their orders are THE HORSEMEN, Nephilim (powerful beings spawned from the unnatural union of angels and demons) who have pledged themselves to the Council and been granted immense power. However, this power came at a tragic cost: the Horsemen were ordered to use their newfound strength to wipe out the rest of their kind. What followed was a bloody battle on Eden where the Horsemen, obeying the will of the Council, annihilated the Nephilim.\r\n\r\nStill reeling from the events on Eden, WAR and STRIFE have been given a new assignment -- LUCIFER, the enigmatic and deceptive demon king, has been plotting to upset the Balance by granting power to master demons throughout Hell. War and Strife must hunt down these masters, gather information, and ultimately fight their way through a tangled, demonic conspiracy that threatens to forever upset the Balance and unravel all of creation.\r\n\r\nDARKSIDERS: GENESIS is an action/adventure game that tears its way through hordes of demons, angels, and everything in-between on its way to Hell and back with guns blazing and swords swinging. Genesis gives players their first look at the world of DARKSIDERS before the events of the original game, as well as introduces the horseman STRIFE.\r\n\r\nFeatures:\r\nBlast angels and demons as the gunslinging Horseman Strife, playable for the first time\r\nSwap between the powerful swordsman War and Strife instantly in frenetic, single-player gameplay\r\nExplore the epic world of Darksiders and wreak havoc with a friend in two-player cooperative mode\r\nExperience a brand new story campaign that takes place before the original Darksiders, exploring the origin of the Seven Seals\r\nGrow in strength and power as you collect items, abilities, weapon enhancements, creature cores and more\r\n', 33.55, 3, 'Available', '1576451233499', '2019-12-16 00:07:00'),
	(9, 3, 'Transport Fever 2 Steam CD Key', '', 'Provide the world with the transport infrastructure it needs and make a fortune with custom-made transport services. Watch your trains run on rails, your buses and trucks thunder along roads, your ships power through the water, and your planes soar through the skies. Carry people on their way to work or play, and be the reason cities grow and thrive. Deliver raw materials and goods to drive the economy. Experience the greatest logistical challenges from 1850 to the present day, and build a transport empire unrivaled anywhere else on the globe!\r\n\r\nFree play offers a huge range of creative possibilities, while campaign mode re-writes transport history across three continents. Transport Fever 2 offers a choice of over 200 vehicles from Europe, America and Asia, modelled in extreme detail; and with the in-game map editor, you can re-create landscapes from three different climate zones. Finally, the realistic transport and economy simulator, along with comprehensive modding support, round off the gameplay experience.\r\n\r\nFeatures:\r\nFree play with countless configuration possibilities\r\nThree campaigns across three continents with over 20 hours of playing time\r\nEditors for creating maps and editing saved games\r\nThree landscape types: moderate, dry, and tropical\r\nRealistically modelled vehicles from Europe, America and Asia\r\nA total of over 200 vehicles: trains, buses, streetcars, trucks, aircraft and ships\r\nModular train stations, bus and truck stations, airports and harbors\r\nRealistic transport simulation including one-way streets and light signals\r\nEditable and paintable terrain with realistic effects\r\nIntuitive construction tools for building railroads and more', 39.66, 9, 'Available', '1576451307899', '2019-12-16 00:08:00'),
	(10, 3, 'Monster Hunter: World EU Steam', '', 'Monster Hunter World check below for the best price worldwide\r\nIncludes:\r\n\r\nBase Game\r\nMonster Hunter: World is an action role-playing game developed and published by Capcom. A part of the Monster Hunter series, it was published worldwide for PlayStation 4 and Xbox One in January 2018, with a Microsoft Windows version being listed for August 2018. In the game, the member takes the role of a Hunter, tasked to hunt down and either kill or trap beasts that travel in one of several environmental spaces. If successful, the player is rewarded through loot consisting of parts from the monster and different elements that are used to craft weaponry and armor, amongst other devices. The game\'s core loop has the player crafting appropriate gear to be able to hunt down more difficult monsters, which in turn provide parts that lead to more powerful gear. Players may hunt alone or can hunt in cooperative groups of up to four players via the game\'s online services.\r\n\r\nAnnounced at E3 2017, Monster Hunter: World adopts the series\' standard formulas from its older home console roots and recent handheld games to take advantage of the higher processing power provided by modern consoles and computers. Changes made in Monster Hunter: World include creating environmental spaces that are fully connected and removing the "zones" that were necessary for the PlayStation 2 and handheld games, more advanced monster artificial intelligence and physics to create seemingly living ecosystems that could be taken advantage of during hunts, a more persistent cooperative multiplayer experience, and a refinement of the game\'s user interface, menu systems, and tutorials to help with bringing new players into the series. These changes led Capcom to plan for the game\'s simultaneous release across both Japan and Western markets since Monster Hunter as a series has generally languished in the West compared to Japan partially due to disparate release schedules. Capcom also opted to support online play between these different geographic regions for similar reasons. The delay for the Windows release was attributed to Capcom seeking to make sure its first foray into the Windows market was optimized for players on computers.\r\n\r\nMonster Hunter: World received critical acclaim upon release, with critics praising how Capcom was able to make the game more accessible to new players and to Western markets, without detracting from the series\' core gameplay elements and enjoyable difficulty, and fully taking advantage of the computational capacity of modern consoles to create living ecosystems. Within a few weeks of release, the game became the fastest-selling game in Capcom\'s history, eventually becoming their best-selling game with over eight million copies shipped by August 2018.', 76.00, 6, 'Available', '1576451449531', '2019-12-16 00:10:00'),
	(11, 3, 'Red Dead Redemption 2 EU Rockstar', '', 'Red Dead Redemption II is the third instalment of the Western series Red Dead. RDR2 is an action game with an open world. This title was developed by Rockstar Games (known for Grand Theft Auto series, Midnight Club or Bully). Red Dead Redemption II action is set in 1899 in times preceding the events of the previous part of the series. We are a part of infamous Dutch van der Linde gang. When the assault in a town ends in failure, criminals are forced to flee from law officers and bounty hunters and as a consequently fight for survival. Relations with other gang members with whom we share the camp are also significant â€” the choices we make determine their attitude towards the hero. In Red Dead Redemption II you take control of Dutch van der Lindeâ€™s right hand â€” Arthur Morgan. You will have to choose between loyalty to friends and protagonist own ideals. The decisions and reputation in the region have an impact on the story. Building relationships with other gang members with whom we share the camp also matters - the choices youâ€™ll make determine their attitude towards the hero.\r\n\r\nFeatures:\r\n\r\nVast open world which consists of rocky mountain areas, valleys covered with rivers, prairies, forests and cities whose inhabitants live their own lives.\r\nTake care of your camp â€” manage supplies, while ensuring the team\'s morale. It is worth noting that this is not only Morgan\'s duty â€” his colleagues also set off to search if something (depending on their role, it can be, for example, wood, food or money) begins to run out.\r\nNeutral characters dynamically respond to our actions depending on reputation, appearance or previous achievements.\r\nHunt for wild animals and earn money by selling furs and meat, but remember corpses start to rot over time!\r\nThere are also duels at noon, during which you must show reflexes and accuracy.\r\nIn addition to the extensive single player mode, Red Dead Redemption II also has a complex multiplayer variant, Red Dead Online.', 66.00, 3, 'Available', '1576451519826', '2019-12-16 00:11:00'),
	(12, 3, 'ARK: Survival Evolved Steam', '', 'As a man or woman stranded naked, freezing and starving on the shores of a mysterious island called ARK, you must hunt, harvest resources, craft items, grow crops, research technologies, and build shelters to withstand the elements. Use your cunning and resources to kill or tame the leviathan dinosaurs and other primeval creatures roaming the land, and team up with or prey on hundreds of other players to survive, dominate... and escape!\r\n\r\nFeatures\r\nTame, train and ride dinosaurs in a living ecosystem\r\nYou must eat and drink to survive, with different kinds of plants & meat having different nutritional properties, including human meat. Ensuring a supply of fresh water to your home and inventory is a pressing concern. All physical actions come at a cost of food and water, long-distance travel is fraught with subsistence peril!\r\nInventory weight makes you move slower, and the day/night cycle along with randomized weather patterns add another layer of challenge by altering the temperature of the environment, causing you to hunger or thirst more quickly.\r\nBuild a fire or shelter, and craft a large variety of customizable clothing & armors, to help protect yourself against locational damage & extreme temperatures using the dynamic indoor/outdoor insulation calculation system.\r\nTend to your crops and they will grow to produce delicious and rare fruits, which can also be used to cook a plethora of logical recipes and make useful tonics! \r\nExplore to find the rarest of plant seeds that have the most powerful properties! Vegetarians & vegans can flourish, and it will be possible to master and conquer the ARK in a non-violent manner!\r\nBy bringing sufficient rare sacrificial items to special Summon locations, you can capture the attention of the one of the ARKâ€™s god-like mythical creatures, who will arrive for battle.\r\nCreate a Tribe and add your friends to it, and all your Pets can be commanded by and allied to anyone in your Tribe.', 55.00, 5, 'Available', '1576451791300', '2019-12-16 00:16:00');
